import React from "react";
import { Link } from "react-router-dom";
import Logo from "../asset/img/logo.png";
import NavBar from "./NavBar";

const Header = ({title}) => {
    return(
        <header>
            <div className="header-contents">
                <div className="main-logo-image" style={{position:"absolute"}}>
                    <Link to="/main"><img src={Logo} alt="이포넷 로고"></img></Link>
                </div>
                <h1 className="class-contents">{title}</h1>
            </div>
        </header>

    );
}

export default Header;
